webpackJsonp([25401968908510],{819:function(n,s){n.exports={data:{page:{id:"/home/cypress/website1/content/pages/5--skils-and-tools/index.md absPath of file >>> MarkdownRemark",html:'<p>Main software tools that I use for my work. </p>\n<h3>Postman</h3>\n<p><a href="https://www.getpostman.com/">https://www.getpostman.com/</a></p>\n<h3>Chrome Developer Tools</h3>\n<p><a href="https://developers.google.com/web/tools/chrome-devtools/">https://developers.google.com/web/tools/chrome-devtools/</a></p>\n<h3>Cypress.io Coding Snippets</h3>\n<h3>Github</h3>\n<p><a href="https://github.com/">https://github.com/</a></p>\n<h3>Git</h3>\n<p><a href="https://git-scm.com/">https://git-scm.com/</a></p>\n<h3>cypress.io</h3>\n<p><a href="https://www.cypress.io/">https://www.cypress.io/</a></p>\n<h3>Unix Commands</h3>\n<p><a href="http://oliverelliott.org/article/computing/ref_unix/">http://oliverelliott.org/article/computing/ref_unix/</a>\n<a href="https://linuxcontainers.org/lxd/try-it/">https://linuxcontainers.org/lxd/try-it/</a></p>\n<h3>Visual Studio Code</h3>\n<p><a href="https://code.visualstudio.com/">https://code.visualstudio.com/</a></p>\n<h3>Visual Studio Extensions</h3>\n<ul>\n<li>\n<p>Markdown Editor\n<a href="https://github.com/DavidAnson/vscode-markdownlint">https://github.com/DavidAnson/vscode-markdownlint</a></p>\n</li>\n<li>\n<p>Bracket Pair Colorizer\n<a href="https://github.com/CoenraadS/Bracket-Pair-Colorizer-2">https://github.com/CoenraadS/Bracket-Pair-Colorizer-2</a></p>\n</li>\n<li>\n<p>Copy Filename to clipboard\n<a href="https://github.com/Jack89ita/vscode-copy-filename">https://github.com/Jack89ita/vscode-copy-filename</a></p>\n</li>\n<li>\n<p>ES6 Mocha Snippets (used for cypress describe and it snippets)\n<a href="https://github.com/spoonscen/es6-mocha-snippets-vs-code">https://github.com/spoonscen/es6-mocha-snippets-vs-code</a></p>\n</li>\n<li>\n<p>User Snippets (I use this for writing the cypress.io .should and .then blocks)\nOpen Visual Studio - File - Preferences - User Snippets and paste this in javascript.json file</p>\n</li>\n</ul>\n<div class="gatsby-highlight" data-language="javascript">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token punctuation">{</span>\n        <span class="token comment">// Place your snippets for javascript here. Each snippet is defined under a snippet name and has a prefix, body and </span>\n        <span class="token comment">// description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:</span>\n        <span class="token comment">// $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the </span>\n        <span class="token comment">// same ids are connected.</span>\n        <span class="token comment">// Example:</span>\n        <span class="token string">"Print to console"</span><span class="token punctuation">:</span> <span class="token punctuation">{</span>\n            <span class="token string">"prefix"</span><span class="token punctuation">:</span> <span class="token string">"log"</span><span class="token punctuation">,</span>\n            <span class="token string">"body"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n                <span class="token string">"console.log(\'$1\');"</span><span class="token punctuation">,</span>\n                <span class="token string">"$2"</span>\n            <span class="token punctuation">]</span><span class="token punctuation">,</span>\n            <span class="token string">"description"</span><span class="token punctuation">:</span> <span class="token string">"Log output to console"</span>\n        <span class="token punctuation">}</span><span class="token punctuation">,</span>\n\n\n        <span class="token string">".then cypress.io"</span><span class="token punctuation">:</span> <span class="token punctuation">{</span>\n            <span class="token string">"prefix"</span><span class="token punctuation">:</span> <span class="token string">".then"</span><span class="token punctuation">,</span>\n            <span class="token string">"body"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n                <span class="token string">".then(($1) => {"</span><span class="token punctuation">,</span>\n                <span class="token string">"    $2"</span><span class="token punctuation">,</span>\n                <span class="token string">"})"</span>\n            <span class="token punctuation">]</span><span class="token punctuation">,</span>\n            <span class="token string">"description"</span><span class="token punctuation">:</span> <span class="token string">".then cypress.io arrow function"</span>\n        <span class="token punctuation">}</span><span class="token punctuation">,</span>\n\n        <span class="token string">".should cypress.io"</span><span class="token punctuation">:</span> <span class="token punctuation">{</span>\n            <span class="token string">"prefix"</span><span class="token punctuation">:</span> <span class="token string">".should"</span><span class="token punctuation">,</span>\n            <span class="token string">"body"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n                <span class="token string">".should(($1) => {"</span><span class="token punctuation">,</span>\n                <span class="token string">"    $2"</span><span class="token punctuation">,</span>\n                <span class="token string">"})"</span>\n            <span class="token punctuation">]</span><span class="token punctuation">,</span>\n            <span class="token string">"description"</span><span class="token punctuation">:</span> <span class="token string">".should cypress.io arrow function"</span>\n        <span class="token punctuation">}</span>\n\n    <span class="token punctuation">}</span></code></pre>\n      </div>\n<h3>Ubuntu Desktop</h3>\n<p><a href="https://ubuntu.com/download/desktop">https://ubuntu.com/download/desktop</a></p>\n<h3>json-server</h3>\n<p><a href="https://github.com/typicode/json-server">https://github.com/typicode/json-server</a></p>\n<h3>Http REST</h3>\n<p><a href="https://restfulapi.net/http-methods/">https://restfulapi.net/http-methods/</a></p>\n<h3>javascript</h3>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript">https://developer.mozilla.org/en-US/docs/Web/JavaScript</a>\n<a href="https://www.w3schools.com/js/default.asp">https://www.w3schools.com/js/default.asp</a></p>\n<h3>SQL</h3>\n<p><a href="https://www.w3schools.com/sql/sql_examples.asp">https://www.w3schools.com/sql/sql_examples.asp</a></p>',frontmatter:{title:"Skills, Technologies and Tools"}},footnote:{id:"/home/cypress/website1/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:""},site:{siteMetadata:{facebook:{appId:""}}}},pathContext:{slug:"/skils-and-tools/"}}}});
